INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 7, 2834, 91002, "ペコリーヌとの出会い", 0, 40, 1, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 10118, 2, 0, "青空の下で謁見", 5118061, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 7, 2835, 91002, "マホとの出会い", 0, 40, 1, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 10118, 2, 0, "未来の騎空団\nマスコット？", 5118062, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ランドソル市街地", 7, 2837, 91002, "アキノとの出会い", 0, 40, 1, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 10118, 2, 0, "お嬢さまからの\n緊急依頼", 5118063, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 18, 4108402, 91002, "ジュンとの出会い", 0, 40, 1, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 10118, 2, 0, "黄金色の悩みごと", 5118064, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 18, 4107402, 91002, "カオリとの出会い", 0, 40, 1, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 10118, 2, 0, "白熱！　格闘大会！", 5118065, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("オーエド町", 16, 9000227, 91002, "ニノンとの出会い", 1, 40, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 10118, 2, 0, "祭り太鼓はオーエドの華", 5118066, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 19, 2101181, 91002, "スズナとの出会い", 0, 40, 1, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 10118, 3, 0, "人気者は遅れて\nやってくる", 5118067, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ランドソル市街地", 18, 4109402, 91002, "ナナカとの出会い", 0, 40, 1, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 10118, 3, 0, "巫女・ミーツ・魔法少女", 5118068, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 18, 4305402, 91002, "キャル＆コッコロとの出会い", 0, 40, 1, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 10118, 3, 0, "ネズ耳は二度なくなる", 5118069, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ランドソル市街地", 18, 4101402, 91002, "ユカリとの出会い", 0, 40, 1, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 10118, 3, 0, "この出会いにカンパイ！", 5118070, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ランドソル市街地", 18, 4106402, 91002, "アオイとの出会い", 0, 40, 1, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 10118, 3, 0, "陰陽アンサンブル", 5118071, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケット会場", 7, 2836, 91002, "シノブとの出会い", 1, 40, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 10118, 3, 0, "運試し十番勝負！", 5118072, 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, 0, 0, 0, "オープニング", 0, 0, 0, 0, 10118, 1, 10145115, "彼女たちの新たな日常", 5118600, 0);
